import React from "react";
import PageBody from './pageBody';
import MarketData from './marketData.js';

class Graphs extends React.Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <div>
                <PageBody mode={this.props.mode} barOptions={this.props.barOptions} barData={this.props.barData} pieData={this.props.pieData} pieOptions={this.props.pieOptions} heatMap={this.props.heatMap} />
                <MarketData lstSvnDays={this.props.lastSevenDays} priceLstSvn={this.props.priceAverages} qtyLstSvn={this.props.averageBuyAndSellQuantitiesOverTheLastSevenDays} name={this.props.name} marketData={this.props.marketData} mode={this.props.mode} />
            </div>
        )
    }
}

export default Graphs;
